module.exports = "<!-- Container-fluid starts -->\n<div class=\"container-fluid\">\n    <div class=\"row\">\n        <div class=\"col-sm-12\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h5>Polticas de Privacidad</h5>\n                </div>\n                <div class=\"card-body\">\n                    <p>El presente Poltica de Privacidad establece los trminos en que Mis Compras usa y protege la\n                        informacin que es\n                        proporcionada por sus usuarios al momento de utilizar su sitio web. Esta compaa est\n                        comprometida con la seguridad\n                        de los datos de sus usuarios. Cuando le pedimos llenar los campos de informacin personal con la\n                        cual usted pueda\n                        ser identificado, lo hacemos asegurando que slo se emplear de acuerdo con los trminos de este\n                        documento.\n                        Sin embargo esta Poltica de Privacidad puede cambiar con el tiempo o ser actualizada por lo que\n                        le recomendamos y\n                        enfatizamos revisar continuamente esta pgina para asegurarse que est de acuerdo con dichos\n                        cambios.\n                    </p>\n                    <p>\n                        <strong>Informacin que es recogida</strong>\n                    </p>\n                    <p>Nuestro sitio web podr recoger informacin personal por ejemplo: Nombre,&nbsp; informacin de\n                        contacto como&nbsp;\n                        su direccin de correo electrnica e informacin demogrfica. As mismo cuando sea necesario\n                        podr ser requerida\n                        informacin especfica para procesar algn pedido o realizar una entrega o facturacin.\n                    </p>\n                    <p>\n                        <strong>Uso de la informacin recogida</strong>\n                    </p>\n                    <p>\n                        Nuestro sitio web emplea la informacin con el fin de proporcionar el mejor servicio posible,\n                        particularmente para\n                        mantener un registro de usuarios, de pedidos en caso que aplique, y mejorar nuestros productos y\n                        servicios. &nbsp;\n                        Es posible que sean enviados correos electrnicos peridicamente a travs de nuestro sitio con\n                        ofertas especiales,\n                        nuevos productos y otra informacin publicitaria que consideremos relevante para usted o que\n                        pueda brindarle algn\n                        beneficio, estos correos electrnicos sern enviados a la direccin que usted proporcione y\n                        podrn ser cancelados\n                        en cualquier momento.</p>\n                    <p>Mis Compras est altamente comprometido para cumplir con el compromiso de mantener\n                        su informacin segura. Usamos los sistemas ms avanzados y los actualizamos constantemente para\n                        asegurarnos\n                        que no exista ningn acceso no autorizado.</p>\n                    <p><strong>Cookies</strong></p>\n                    <p>Una cookie se refiere a un\n                        fichero que es enviado con la finalidad de solicitar permiso para almacenarse en su ordenador,\n                        al aceptar\n                        dicho fichero se crea y la cookie sirve entonces para tener informacin respecto al trfico web,\n                        y tambin\n                        facilita las futuras visitas a una web recurrente. Otra funcin que tienen las cookies es que\n                        con ellas las\n                        web pueden reconocerte individualmente y por tanto brindarte el mejor servicio personalizado de\n                        su web.\n                    </p>\n                    <p>\n                        Nuestro sitio web emplea las cookies para poder identificar las pginas que son visitadas y su\n                        frecuencia.\n                        Esta informacin es empleada nicamente para anlisis estadstico y despus la informacin se\n                        elimina de\n                        forma permanente. Usted puede eliminar las cookies en cualquier momento desde su ordenador. Sin\n                        embargo\n                        las cookies ayudan a proporcionar un mejor servicio de los sitios web, ests no dan acceso a\n                        informacin\n                        de su ordenador ni de usted, a menos de que usted as lo quiera y la proporcione directamente,\n                        <a href=\"\" target=\"_blank\"></a>. Usted puede aceptar o negar el uso de cookies, sin embargo la\n                        mayora de\n                        navegadores aceptan cookies automticamente pues sirve para tener un mejor servicio web. Tambin\n                        usted puede\n                        cambiar la configuracin de su ordenador para declinar las cookies. Si se declinan es posible\n                        que no pueda\n                        utilizar algunos de nuestros servicios.\n                    </p>\n                    <p>\n                        <strong>Enlaces a Terceros</strong>\n                    </p>\n                    <p>Este sitio web pudiera contener en laces a otros sitios que pudieran ser de su inters. Una vez\n                        que usted de clic en estos\n                        enlaces y abandone nuestra pgina, ya no tenemos control sobre al sitio al que es redirigido y\n                        por lo tanto no somos\n                        responsables de los trminos o privacidad ni de la proteccin de sus datos en esos otros sitios\n                        terceros. Dichos sitios\n                        estn sujetos a sus propias polticas de privacidad por lo cual es recomendable que los consulte\n                        para confirmar que\n                        usted est de acuerdo con estas.\n                    </p>\n                    <p>\n                        <strong>Control de su informacin personal</strong>\n                    </p>\n                    <p>En cualquier momento usted puede restringir la recopilacin o el uso de la informacin personal\n                        que es proporcionada a nuestro\n                        sitio web.&nbsp; Cada vez que se le solicite rellenar un formulario, como el de alta de usuario,\n                        puede marcar o desmarcar\n                        la opcin de recibir informacin por correo electrnico. &nbsp;En caso de que haya marcado la\n                        opcin de recibir nuestro\n                        boletn o publicidad usted puede cancelarla en cualquier momento.</p>\n                    <p>Esta compaa no vender, ceder ni distribuir\n                        la informacin personal que es recopilada sin su consentimiento, salvo que sea requerido por un\n                        juez con un orden judicial.\n                    </p>\n                    <p>\n                        Mis Compras Se reserva el derecho de cambiar los trminos de la presente Poltica de Privacidad\n                        en cualquier momento.\n                    </p>\n                </div>\n            </div>\n        </div>\n    </div>\n</div>\n<br/>\n<br/>\n<!-- Container-fluid starts -->"

